<?php

namespace App\Tests\Service;

use App\Service\Base64ImageService;
use Symfony\Bundle\FrameworkBundle\Test\WebTestCase;
use Symfony\Component\DependencyInjection\ParameterBag\ParameterBagInterface;
use Symfony\Component\HttpFoundation\File\File;

/**
 *  Processes base64 string, converts to file and saves
 *
 * @author     Andrew Derevinako <andreyy.derevjanko@gmail.com>
 * @version    1.0
 */
class Base64ImageServiceTest extends WebTestCase
{
    private $encodedImage = 'data:image/jpeg;base64,';

    private $fileDirectory = 'tests';
    private $fileName = 'base64Image';

    /**
     * Converts base64 image data to file
     */
    public function testConvertToFile()
    {
        self::bootKernel();
        $service = self::$container->get(Base64ImageService::class);

        $file = $service->convertToFile($this->encodedImage);
        $this->assertInstanceOf(File::class, $file);
    }

    public function testSaveImage()
    {
        $parameterBagInterface = $this->createMock(ParameterBagInterface::class);
        $parameterBagInterface->expects($this->once())
            ->method('get')
            ->willReturn('tests/uploads');

        $service = new Base64ImageService($parameterBagInterface);
        $file = $service->convertToFile($this->encodedImage);
        $filePath = $service->saveImage($this->encodedImage, $this->fileDirectory, $this->fileName);
        $this->assertIsString($filePath);
        $this->assertFileExists($filePath);
        $this->assertFileIsReadable($filePath);
        unlink($filePath);
    }

}